DELIMITER $$
--
-- Procedimentos
--
CREATE DEFINER=`lifecartoes`@`10.%` PROCEDURE `sp_boletos_registro` (IN `pid_cliente` INT)  BEGIN
SELECT 
(SELECT COUNT(*) FROM faturamento WHERE id_cliente = pid_cliente) AS total_boletos,
(SELECT COUNT(*) FROM faturamento WHERE id_cliente = pid_cliente AND data_pagamento > 0) AS boletos_pagos;

END$$

CREATE DEFINER=`lifecartoes`@`10.%` PROCEDURE `sp_clientes_relatorio` (IN `pid_vendedor` INT, IN `pmes` INT, IN `pano` INT)  BEGIN
	SELECT id_cliente, CONVERT(valor / 2, DECIMAL(10,2)) AS comissao FROM faturamento WHERE id_cliente IN(
	SELECT id_cliente FROM clientes 
	WHERE id_cliente IN(SELECT id_cliente FROM clientes WHERE id_indicador = pid_vendedor) 
	ORDER BY id_cliente ASC) AND nparcela = 1 AND MONTH(data_pagamento) = pmes AND YEAR(data_pagamento) = pano;

END$$

DELIMITER ;

